import React, { useEffect } from "react";
import { db } from "../utils/config";
import {
  collection,
  getDoc,
  addDoc,
  updateDoc,
  doc,
  arrayUnion,
  arrayRemove,
} from "firebase/firestore";
import { DataContext } from "../../service/DataContext";
const { userData, userAuthState, siteDate } = useContext(DataContext);

function SendTestData() {
  useEffect(() => {
    const testDataSend = async () => {
      let data = {
        s1: {
          date: setNowDate.day + "-" + setNowDate.month + "-" + setNowDate.year,
          pnl: 6000,
          detail: {
            noOfTrade: 3,
            trade1: {
              scripName: "Nifty",
              direction: "Long",
              pnl: 2000,
            },
            trade2: {
              scripName: "Nifty",
              direction: "Long",
              pnl: 2000,
            },
            trade3: {
              scripName: "Nifty",
              direction: "Long",
              pnl: 2000,
            },
          },
        },
      };
      console.log(data);
      // for (let i = 0; i < 5; i++) {
      //   data.push(data[i]);
      // }

      const testingSendingData = doc(db, "users", "devscryptcomp@gmail.com");
      // await updateDoc(testingSendingData, { strategyTags: arrayUnion(data) });
      await updateDoc(testingSendingData, { data });
    };
    testDataSend();
  }, []);
  return <div></div>;
}

export default SendTestData;
